Grade level: 6 Key to Finding the Context

Paragraph: Climate change is affecting our planet in many ways. The _______ changes in temperature have caused polar ice to melt faster than ever before. Many coastal areas are experiencing flooding _______ to rising sea levels. Scientists are working hard to find solutions to these environmental problems.

Question: [
    {
        "question_1": "Which word best completes the first blank?",
        "answer_choices_1": {
            "A": "subtle",
            "B": "gradual",
            "C": "drastic",
            "D": "minor"
        },
        "teacher_solution_1": {
            "correct_answer": "C",
            "explanation": "Choice C (drastic) is correct because the context suggests severe and extreme changes in temperature that are causing ice to melt rapidly. Choice A (subtle) and D (minor) are incorrect because they suggest small changes, which wouldn't cause such significant effects. Choice B (gradual) is incorrect because the passage implies sudden and dramatic changes rather than slow ones."
        },
        "question_2": "Which word best completes the second blank?",
        "answer_choices_2": {
            "A": "close",
            "B": "next",
            "C": "due",
            "D": "near"
        },
        "teacher_solution_2": {
            "correct_answer": "C",
            "explanation": "Choice C (due) is correct because it properly expresses the cause-and-effect relationship between rising sea levels and flooding. Choice A (close), B (next), and D (near) are incorrect because they express physical proximity rather than causation, which doesn't fit the logical relationship described in the sentence."
        }
    }
]


